import { useEffect, useState } from 'react';

function Clock() {
    const [second, setSecond] = useState();
    useEffect(() => {
        const now = new Date();
        setSecond()
        const currentSecond = now.getSeconds();
        return currentSecond;
    })

    return (
        <p>{second}</p>
    );
}


export default Clock;
